import React, { useState, useEffect } from 'react';
import {useCookies} from 'react-cookie';
import axios from '../api/axios';

const TICKET_URL = '/ticket-list';

const Profile = () => {
    const [cookies, setCookies] = useCookies(['users']);
    const [tickets, setTickets] = useState([]);
   
    useEffect(() => {
        const getTickets = async () => {
            const {data: res} = await axios.get(TICKET_URL)
            console.log(res);
            setTickets(res);
        };
        getTickets();
    }, [])

    console.log(tickets);
    // if(ticket.name === cookies.users.name && ticket.lastname === cookies.users.lastname)
    // {
    //     console.log(ticket);
    // }
    return(
        <>
            <div className='container d-flex profile justify-content-center'>
                {cookies.users ? cookies.users.map((item) => (
                    <div className="card card-ticket text-center">
                        <div className="card-header">
                            Loterijos bilietas #{item.ticketNumber}
                        </div>
                        <div className='card-body'>
                            <p>{item.name}</p>
                            <p>{item.lastname}</p>
                        </div>
                    </div>
                )): (
                    <div className="card card-ticket text-center">
                        <div className="card-header">
                            Informacija
                        </div>
                        <div className='card-body'>
                            <p>Šiuo metu neturite įsigyjęs loterijos bilieto</p>
                        </div>
                    </div>
                )}
            </div>
        </>
    )
}

export default Profile;
